import * as React from "react";
import {
  ListItem,
  ListItemIcon,
  // ListItemText,
  Box,
  Drawer,
  Toolbar,
  List,
  Avatar,
  Modal,
  Typography,
  // FormControlLabel
} from "@mui/material";

import Navbars from "../Navbar/navbarChat";
import Status from "./status";
import { Paper, IconButton, InputBase } from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import {
  FaHome,
  FaLanguage,
  FaShoppingCart,
  FaTelegramPlane,
} from "react-icons/fa";

import {
  IoChatbubblesSharp,
  IoNotifications,
  IoSettingsSharp,
  IoDocumentText,
} from "react-icons/io5";

import { FiLogOut } from "react-icons/fi";

const drawerWidth = 100;
export default function Chat() {
const [createQ, setCreateQ] = React.useState(false);
// const [payOpen, setPayOpen] = React.useState("");
const [step, setStep] = React.useState(0);


// const [date, setDate] = React.useState("");
// const [translatorname, setTranslatorname] = React.useState("");
// const [customername, setCustomername] = React.useState("");
// const [jobdescription, setJobdescription] = React.useState("");
// const [deadline, setDeadline] = React.useState("");
// const [price, setPrice] = React.useState("");

// const [customerswillget, setCustomerswillget] = React.useState("");
// const [numberofedits, setNumberofedits] = React.useState("");

const handleClose = () => setCreateQ(false);

const Create_Quotation = ()=>{
  setCreateQ(true);
  console.log()
  return( 
  <Modal
    keepMounted
    open={createQ}
    onClose={handleClose}
    aria-labelledby="keep-mounted-modal-title"
    aria-describedby="keep-mounted-modal-description"
  >
    <Box
      sx={{
        position: "absolute",
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -70%)",
        width: 600,
        bgcolor: "background.paper",
        boxShadow: 24,
        p: 4,
        borderRadius: 5,
        border: "1px solid #E5E5E5",
        textAlign: "center",
      }}
    >
      <Typography
        id="keep-mounted-modal-description"
        sx={{ mt: 2, fontWeight: 700 }}
      >
        Terms and Conditions
      </Typography>
      <Typography
        id="keep-mounted-modal-description"
        sx={{
          mt: 2,
          textAlign: "left",
          overflowY: "auto",
          height: 200,
        }}
      >
        If you click on "Allow all cookies", you consent to the
        storage and accessing of information stored to such cookies
        on your device, to the processing of your respective
        personal data, and to the transfer of this data to countries
        that do not ensure the same level of data protection as the
        EU, in particular the USA. You can find more information on
        the subject of your consents in our Privacy Policy and under
        "Show details". We use cookies to store your preferences
        when using our website, to statistically analyze your usage
        behavior, and to display personalized advertising on
        third-party websites or social media. This data may be used
        by us and our partners to enrich usage profiles. You can
        revoke your consent at any time, but only with effect for
        the future. To do so, please click on the link to our
        Privacy Policy, which you will find in the footer of our
        website, and use the "Change your consent" function there.
      </Typography>
      <div
        style={{
          textAlign: "left",
          borderTop: "1px solid #C4C4C4",
        }}
      >

      </div>
      <div>
        {/* {checked === false ? (
          <button
            style={{
              width: "30%",
              borderRadius: 20,
              background: "#E0E0E0",
              height: 40,
              color: "#FFFFFF",
              fontSize: 18,
              borderColor: "transparent",
              position: "relative",
              left: "35%",
            }}
            disabled
            // onClick={handleOpen}
          >
            Submit
          </button>
        ) : (
          <button
            style={{
              width: "30%",
              borderRadius: 20,
              background: "#001E33",
              height: 40,
              color: "#FFFFFF",
              fontSize: 18,
              borderColor: "transparent",
              position: "relative",
              left: "35%",
            }}
            onClick={handleClose}
          >
            Submit
          </button>
        )} */}
      </div>
    </Box>
  </Modal>

  )
}


  return (
    <div className="App-body">
      <header className="App-header">
        <Navbars />
      </header>
      <Box sx={{ display: "flex", width: "100% " }}>
        <Drawer
          variant="permanent"
          anchor="left"
          sx={{
            width: drawerWidth,
            [`& .MuiDrawer-paper`]: {
              width: drawerWidth,
              boxSizing: "border-box",
            },
            background: "#FFFDF7",
          }}
          style={{ zIndex: 0, height: "100%" }}
        >
          <Toolbar />
          <Box sx={{ overflow: "hidden" }} className={"manu3"}>
            <List>
              {["1", "2", "3", "4", "5"].map((text, index) => (
                <ListItem button key={text} id={"button_manu"}>
                  <ListItemIcon id={"button_icons"}>
                    {index === 0 ? (
                      <FaHome className="icons" />
                    ) : index === 1 ? (
                      <FaLanguage className="icons" />
                    ) : index === 2 ? (
                      <FaShoppingCart className="icons" />
                    ) : index === 3 ? (
                      <IoChatbubblesSharp className="icons" />
                    ) : index === 4 ? (
                      <IoNotifications className="icons" />
                    ) : null}
                  </ListItemIcon>
                </ListItem>
              ))}
            </List>
          </Box>
        </Drawer>

        <Box component="main">
          <div
            style={{
              width: 300,
              position: "fixed",
              height: "-webkit-fill-available",
            }}
          >
            <div style={{ position: "absolute", top: 65, left: 25 }}>
              <p style={{ color: "#353535", fontSize: 30, fontWeight: 700 }}>
                Chat
              </p>

              <Paper
                component="form"
                sx={{
                  p: "2px 4px",
                  display: "flex",
                  alignItems: "center",
                  width: 250,
                  position: "absolute",
                  borderRadius: 3,
                  backgroundColor: "#FFFFF",
                  boxShadow: "none",
                  marginTop: 2,
                  border: "1px #e5e5e5 solid",
                }}
              >
                <IconButton
                  type="submit"
                  sx={{ p: "10px", color: "#034D82" }}
                  aria-label="search"
                >
                  <SearchIcon style={{ color: "#BFBFBF" }} />
                </IconButton>
                <InputBase
                  sx={{ ml: 1, flex: 1 }}
                  placeholder="Search"
                  inputProps={{ "aria-label": "search google maps" }}
                />
              </Paper>

              <div
                style={{
                  position: "relative",
                  top: 100,
                  color: "#353535",
                  fontWeight: 500,
                  fontSize: 18,
                }}
              >
                <div
                  style={{
                    background: "#E6F2FA",
                    position: "absolute",
                    width: 250,
                    borderRadius: 12,
                    padding: 7,
                  }}
                >
                  <div style={{ float: "left" }}>
                    <Avatar
                      alt="avatar"
                      src={require("../../Images/Avatar.png")}
                      style={{
                        width: 35,
                        height: "auto",
                        margin: 10,
                        display: "block",
                      }}
                    />
                  </div>
                  <div style={{ float: "left", paddingTop: 7 }}>
                    <p>Sammy Wang</p>
                  </div>
                  <div style={{ float: "left" }}>
                    <p
                      style={{
                        color: "#808080",
                        fontWeight: 0,
                        fontSize: 12,
                        marginLeft: 15,
                      }}
                    >
                      2:08 PM
                    </p>
                  </div>
                  <div
                    style={{ position: "relative", right: 30, paddingTop: 40 }}
                  >
                    <p
                      style={{
                        color: "#808080",
                        fontWeight: 0,
                        fontSize: 15,
                        margin: 10,
                      }}
                    >
                      You : I want to ...
                    </p>
                  </div>
                </div>

                <div
                  style={{
                    background: "#FFFFFF",
                    position: "absolute",
                    width: 250,
                    borderRadius: 12,
                    padding: 7,
                    top: 115,
                    border: "1px #E5E5E5 solid",
                  }}
                >
                  <div style={{ float: "left" }}>
                    <Avatar
                      alt="avatar"
                      src={require("../../Images/Avatar2.png")}
                      style={{
                        width: 35,
                        height: "auto",
                        margin: 10,
                        display: "block",
                      }}
                    />
                  </div>
                  <div style={{ float: "left", paddingTop: 7 }}>
                    <p>Michael Lee</p>
                  </div>
                  <div style={{ float: "left" }}>
                    <p
                      style={{
                        color: "#808080",
                        fontWeight: 0,
                        fontSize: 12,
                        marginLeft: 15,
                      }}
                    >
                      1:08 PM
                    </p>
                  </div>
                  <div
                    style={{ position: "relative", right: 30, paddingTop: 40 }}
                  >
                    <p
                      style={{
                        color: "#808080",
                        fontWeight: 0,
                        fontSize: 15,
                        margin: 10,
                      }}
                    >
                      You : I want to ...
                    </p>
                  </div>
                </div>
              </div>
            </div>
          </div>

          <div
            style={{
              width: "52%",
              position: "fixed",
              height: "-webkit-fill-available",
              background: "#FFFFFF",
              left: 400,
              border: "1px #e5e5e5 solid",
            }}
          >
            <div
              style={{
                width: "inherit",
                position: "fixed",
                height: 100,
                top: 70,
                textAlign: "left",
                fontSize: 24,
                fontWeight: 600,
                borderBottom: "1px #e5e5e5 solid",
                padding: 25,
              }}
            >
              <Avatar
                src={require("../../Images/Avatar.png")}
                style={{
                  width: 35,
                  height: "auto",
                  margin: 10,
                  float: "left",
                }}
              />
              <p style={{ marginTop: 10 }}>Sammy Wang</p>
            </div>

            <div
              style={{
                padding: 15,
                width: "100%",
                height: "64vh",
                overflow: "scroll",
                position: "absolute",
                top: 135,
              }}
            >
              <div
                style={{
                  margin: 20,
                  marginTop: 0,
                }}
              >
                <div style={{ float: "left" }}>
                  <Avatar
                    alt="avatar"
                    src={require("../../Images/Avatar.png")}
                    style={{
                      width: 35,
                      height: "auto",
                      margin: 10,
                      display: "block",
                    }}
                  />
                </div>
                <div
                  style={{
                    padding: 7,
                    background: "rgb(247 244 244)",
                    width: 200,
                    height: "auto",
                    borderRadius: 12,
                    overflow: "hidden",
                    textAlign: "initial",
                    fontSize: 15,
                  }}
                >
                  <p>
                    Hello, I'm Sammy Wang. I'm your translator. You can inquire
                    here. I will reply you as soon as possible
                  </p>
                  <div
                    style={{
                      color: "#808080",
                      fontWeight: 0,
                      fontSize: 12,
